(6, 'Debate: Beneficios de tener mascotas', 'Únete a un apasionante debate donde exploraremos el papel de las mascotas en nuestras vidas y su influencia en la sociedad actual. Este evento reunirá a expertos, amantes de los animales, y personas con diferentes perspectivas para discutir temas como el impacto emocional de las mascotas en los hogares, su relación con la salud mental, los derechos de los animales, y los desafíos de la adopción responsable. ¡Prepárate para un intercambio de ideas dinámico!', 10, '2024-12-27', '17:15:00', 'Sala Principal de la Facultad', 12, 12, 4, );
INSERT INTO `eventos` (`id`, `titulo`, `descripcion`, `precio`, `fecha`, `hora`, `ubicacion`, `capacidad_maxima`, `id_organizador`, `id_categoria`, `foto`) VALUES
(7, 'Concierto de musica clasica', 'Disfruta de una velada inolvidable llena de magia y elegancia con un concierto de música clásica al aire libre. Déjate envolver por las melodías de grandes compositores como Mozart, Beethoven y Vivaldi, interpretadas por una orquesta de renombre. Bajo la luz de las estrellas, este evento promete ser una experiencia única que combina la majestuosidad de la música clásica con la serenidad de un entorno natural. Ideal para melómanos y para quienes buscan una noche de arte y sofisticación.', 20, '2024-12-25', '21:00:00', 'Sala de conciertos', 7, 12, 5, );
INSERT INTO `eventos` (`id`, `titulo`, `descripcion`, `precio`, `fecha`, `hora`, `ubicacion`, `capacidad_maxima`, `id_organizador`, `id_categoria`, `foto`) VALUES
